addEventListener('fetch', event => {
  event.respondWith(fetchAndApply(event.request))
})

async function fetchAndApply(request) {  
  if (request.method === 'GET' ) {
    const parsedUrl = new URL(request.url)
    let path = parsedUrl.pathname

    if (path.charAt(0) == "/") {
      path = path.substr(1);
    } 

    if (path.match(/^pc\/search/))
    {
      console.log("In search")
      for (let p of parsedUrl.searchParams) {
        console.log("PARAM: " + p)
      }

      if (!parsedUrl.searchParams.has("suburb"))
      {
         return new Response('Suburb search missing param',
           { status: 500, statusText: 'Missing param' })      

      }
      else
      {
        suburb = parsedUrl.searchParams.get("suburb")
      }

      var suburbs = getPostcodeByName(suburb)

      if (suburbs !== false)
      {
        const responseInit = {
          status: 200,
          headers: {'Content-Type': 'application/json'}
        }        
        
        return new Response(JSON.stringify(suburbs), responseInit)
      }
      else {
        return new Response('Suburb not found', { status: 404, statusText: 'Not found' })
      }      
    }

    console.log("Checking path: " + path + " length: " + path.length)

    if (!path.match(/^pc\/[0-9]{3,4}$/))
    {
      console.log("Requested postcode (" + postcode + ") is non-numeric or not 3 or 4 digits")
      return new Response('Postcode search must be three or four digits only',
         { status: 500, statusText: 'Invalid postcode search' })      
    }
    else
    {
      path = path.substr(3)
      postcode = getPostcode(path)

      console.log(postcode)

      if (postcode !== false )
      {
        console.log ("All good, returning JSON result")
        const responseInit = {
          status: 200,
          headers: {'Content-Type': 'application/json'}
        }        
        return new Response(JSON.stringify(postcode), responseInit )
      }
      else {
        return new Response('Postcode not found', { status: 404, statusText: 'Not found' })
      }
    }
  }
}

