function getPostcodeByName(suburb)
{
  var suburbArr = []

  for (var key in postcodeDB) {
      if (postcodeDB.hasOwnProperty(key)) {
          if (postcodeDB[key].l == suburb.toUpperCase())
          {
            console.log(key + " -> " + postcodeDB[key])
            suburbArr.push(postcodeDB[key])
          }
      }
  }

  if (suburbArr.length == 0)
  {
    console.log("returning false")
    return false
  }
  else
    return suburbArr

}

function getPostcode(postcode)
{

  var postcodeArr = []

  for (var key in postcodeDB) {
      if (postcodeDB.hasOwnProperty(key)) {
          if (postcodeDB[key].p == postcode)
          {
            //console.log(key + " -> " + postcodeDB[key])
            postcodeArr.push(postcodeDB[key])
          }
      }
  }

  if (postcodeArr.length == 0)
  {
    console.log("returning false")
    return false
  }
  else
    return postcodeArr

}
